import React from 'react'
import ReviewList from './ReviewList'

const ReviewPage = ({episodeNumReviewPage}) => {
  return (
    <div>
        <ReviewList episodeNumReviewPage={episodeNumReviewPage}/>
    </div>
  )
}

export default ReviewPage
